import './App.css';
import Navbar from './components/Navbar.jsx';
import Header from './components/Header.jsx';
import About from './components/About.jsx';
import ProjectMenu from './components/ProjectMenu.jsx';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Header />
      <About />
      <ProjectMenu />
    </div>
  );
}

export default App;
